void yyerror(char const *msg) {
  if (syntax_error) {
    printf("%d: %s at '%s'\n", yylineno, msg, yytext);
  }
yylineno = 0;
}
int string_tonumber(char *str) {
  YY_BUFFER_STATE bp = yy_scan_string(str);
  yy_switch_to_buffer(bp);
  syntax_error = false;
  int n = yyparse();
  syntax_error = true;
  if (input() != EOF) {
    n = 1;
  }
  yy_delete_buffer(bp);
  return n;
  }


